import React, { Component } from "react";
import NavBarBrand from "./navbarbrand";
import NavBarSearch from "./navbarsearch";
import NavBarProfile from "./navbarprofile";
import NavBarToggleButton from "./navbartogglebutton";
import "./navbarcss.css";

class NavBar extends Component {
  getVerticalNavBar() {
    // let elHeight = document.getElementById('container').clientHeight
    return (
      <React.Fragment>
        <nav
          className={"navbar navbar-light bg-light mr-auto float-lg-left full-"}
          style={{
            borderRight: "0.5px solid #9E9E9E",
            float: "left",
            width: "100%",
            minHeight: "100vh"
          }}
        >
          <ul class="nav flex-column nav-pills">
            <li class="nav-item">
              <a class="nav-link active" href="#">
                Active
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#">
                Link
              </a>
            </li>
          </ul>
        </nav>
      </React.Fragment>
    );
  }

  getHorizontalNavBar() {
    return (
      <div>
        <nav
          className={"navbar navbar-expand-lg navbar-light bg-light"}
          style={{
            borderBottom: "0.5px solid #9E9E9E",
            padding: "0"
          }}
        >
          <NavBarToggleButton />
          <NavBarBrand />
          <NavBarSearch />
          <NavBarProfile />
        </nav>
      </div>
    );
  }

  render() {
    const { isHorizontal } = this.props;
    let navBar;
    if (isHorizontal === true) navBar = this.getHorizontalNavBar();
    else navBar = this.getVerticalNavBar();
    return <div>{navBar}</div>;
  }
}

export default NavBar;
